- "«": [T: tanda kutip sudut ganda menunjuk ke kiri] # 0xab
- "¯": [t: "baris"]                                # 0xaf (en: 'line')
 - "¯":                                            # 0xaf
     - test:
        if: "ancestor::m:modified-variable and preceding-sibling::*[1][self::m:mi]"
        then: [t: "baris"]                          # (en: 'bar') -- as in "x bar", a shorthand way to speak this
        else: [t: "baris"]                        # (en: 'line')

- "°": [T: 'derajat'] # 0xb0
